import React from 'react'
import { StyleSheet, Text, View } from 'react-native'
import { Input } from 'react-native-elements'
import { PaymentCardProps } from './types'

const SubscriptionCharge = (props: PaymentCardProps) => {
    return (
        <View style={styles.container}>
            <View style={styles.otherPriceContainer}>
                    <Text style={{alignSelf:"center", marginBottom: 30}}>몇명의 인원이 사용하나요?</Text>
                    <Input
                        placeholder="10"
                        style={styles.inputFont}
                        keyboardType='number-pad'
                        textAlign='center'
                    />
                </View>
        </View>
    )
}

export default SubscriptionCharge

const styles = StyleSheet.create({
    container:{
        width: 550,
        paddingHorizontal: 50,
        paddingVertical: 62,
        alignItems:"center"
    },
    otherPriceContainer:{
        width:190,
        height:90,
        borderBottomColor:"#00000030",
    },
    inputFont:{
        fontWeight:'400',
        lineHeight:36,
        letterSpacing:-0.3,
        fontSize:34,
        color:"#FB8C00",
        textAlign:'center'
    }
})
